bool isValid(vector<int>& arr, unordered_set<int> &v, int idx) {
    return idx >= 0 && idx < arr.size() && v.find(idx) == v.end();
}

void push(queue<int> &q, unordered_set<int> &v, int idx) {
    q.push(idx);
    v.insert(idx);
}

bool canReach(vector<int>& arr, int start) {
    queue<int> q;
    unordered_set<int> v;

    push(q, v, start);
    while (!q.empty()) {
        int cur = q.front();
        q.pop();
        if (arr[cur] == 0) return true;
        if (isValid(arr, v, cur + arr[cur])) push(q, v, cur + arr[cur]);
        if (isValid(arr, v, cur - arr[cur])) push(q, v, cur - arr[cur]);
    }
    return false;
}

